window.avsr = window.avsr || {};
window.avsr.specifics = window.avsr.specifics || (function () {

	var availability =
	{
		logParametersInQuery: false,
		isRecoEnabled: true, 
		isUserActionsEnabled: true,
		isTimeLoggingEnabled: true,
		isCallLoggingEnabled: true,
		isUserInitEnabled: true,
		isRecommendationCached: false,
		disabledActionsList: []
	};

	var abTestPart = 20;
	var templateKey = "figaro";
	var ressources = null;
	var isCrossDomain = true;
	var project = { "Id": 12, "groupKey": "FIGARO", "cssKey": "" };
	var configurations = { };

	var setConnectedTemplate = function (params) {

		_$("#userName").text(avsr.context.currentMember.name);
		_$("#pictureUrl").attr("src", avsr.context.currentMember.pictureUrl);

		_$("#logoutReco").click(function () {
			avsr.auth.logout({
				"callback": function (response) {
					_sr.init({
						"callback": function () {
							var htmlNotConnected = _$("#RecommendedItemsContainer").html();
							_sr.getRecommendation();
							_$("#RecommendedItemsContainer").html(htmlNotConnected);
						}
					});
				}
			});
		});

		bindFbConnectButton(params);
		ellipsify();
	};

	var setDisconnectedTemplate = function (params) {
		bindFbConnectButton(params);
		ellipsify();
	};

	var preprocessBinding = function (params) {
		var sendLog = false;
		for (var i = 0; i < params.RecommendedItems.length; i++)
		{
			var item = params.RecommendedItems[i];
			if (item.title && item.pictures &&
				item.pictures[1] &&
				item.clientProductId &&
				item.informations.DiscountPercent &&
				item.informations.DisplayedPrice &&
				item.informations.Venue)
			{
				// we have all information
			}
			else
			{
				sendLog = true;
				break;
			}
		}

		if (sendLog) {
			avsr.monitoring.logClientCall("MissedDataForTemplate");
		}
	}

	var bindFbConnectButton = function (params) {
	};

	var ellipsify = function () {
		_$(function () {
			_$("#RecommendedItemsContainer .strip-rec-link-title").dotdotdot({
				height: 50
			});
		});
	};

	var openHelpPopup = function () {
		window.open('//www.ticketac.com/recommandations-spectacles/', '', 'width=950,height=760,location=no');
	};

	var trackClickGA = function (location) {
		if (window._gat) {
			var that = _$(this);
			that.attr("data-sr-redirectReady", "false");
			_gaq.push(['_set', 'hitCallback', function () {
				// google analytics callback function
				_gaq.push(['_set', 'hitCallback', null]);
				that.removeAttr("data-sr-redirectReady");
			}]);
			var group = 'ClicReco';
			if (avsr.identity.isAbTestGroup()) {
				group = 'ClicStandard';
			}
			_gaq.push(['_trackEvent', 'Antvoice', group, location]);
		}
	};

	var getRecoTriggeringDistance = function (params) {
		if (params && params.catalogId == 9){
			if (params.location == "HomePage" ||
				params.location == 'CategoryPage' ||
				params.location == 'ProductPage') {
				return 500;
			}
		}

		return -1;
	};

	return {
		availability: availability,
		isCrossDomain: isCrossDomain,
		project: project,
		noCss: true,
		configurations: configurations,
		setConnectedTemplate: setConnectedTemplate,
		setDisconnectedTemplate: setDisconnectedTemplate,
		preprocessBinding: preprocessBinding,
		openHelpPopup: openHelpPopup,
		ressources: ressources,
		templateKey: templateKey,
		trackClickGA: trackClickGA,
		abTestPart: abTestPart,
		getRecoTriggeringDistance: getRecoTriggeringDistance
	};

})();
_srAsyncInit();
